  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valentine NWR
  outlines Refuge accomplishments for May of 1938. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, upland game birds, furbearers, predators, reptiles, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, and collections and receipts. Photographs are attached.\",\n\t\"license_title\":
